import { PeticionPut } from '../src/veronicaApi/peticionPut';
import { Button } from 'react-bootstrap';
import { Form } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
function App() {

  const eventSubmit = (event) => {

    PeticionPut().then((res => {
      console.log("Resultttt: " + res)
    }));
    event.preventDefault();
  }

  return (

    <div className="App">
      <h2>Predicción de incidentes de Tránsito</h2>
      <form onSubmit={eventSubmit}>
        <label>
          Año:
          <input type="text" name="anio" />
        </label>
        <label>
          Mes:
          <input type="text" name="mes" />
        </label>

        <Button variant="danger" type='submit' >Predecir</Button>
      </form>


      <Form>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>Email address</Form.Label>
          <Form.Control type="email" placeholder="Enter email" />
          <Form.Text className="text-muted">
            Ingresar un año para realizar la Predicción
          </Form.Text>
        </Form.Group>

        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control type="password" placeholder="" />
        </Form.Group>

        <Button variant="danger" type="submit">
         Predecir
        </Button>
      </Form>


    </div>

  );
}

export default App;
